import './style.css';

function Header() {
    return (
        <header>
            <img 
                src="https://i.ibb.co/8mkZ00b/Trollface.png" 
                alt="Troll Face"
                width="120"
            />
            <p>Meme Generator</p>
        </header>
    );
}

export default Header;
